import React from "react";

import { Container, Header, Content, Footer } from "./styles";

const Card: React.FC = (props) => (
  <Container>
    {console.log("props", props)}
    <Header>{props.name}</Header>
    <Content>Content</Content>
    <Footer>Footer</Footer>
  </Container>
);

export default Card;
